import React from 'react';
import styled from 'styled-components';

export default function RecipeCard(props) {
  return (
    <Li style={ {display: 'inline'} } key={ props.id }> 
      <p> 
        { props.title }  
      </p>
      <p> 
        { props.image }  
      </p>
      <p> 
        { props.dishTypes }  
      </p>
      <p> 
        { props.diets }  
      </p>
    </Li>
  )
};

const Li = styled.li`

  heigth: 100px;
  background-color: green;
`;
